const App = () => {
  return (
    <>
    <BrowserRouter>
      <GlobalStyle />
        <Routes>
          <Route path="/" element={<MainPage/>} />
          <Route path="/reservation" element={<MainPage/>} />
        </Routes>
      </BrowserRouter>
    </>
  );
};

export default App;
